import moment from 'moment'

const initialState = {
    events: [{
        title: 'Cumpleaños del jefe',
        start: moment().toDate(),
        end: moment().add(2, 'hours').toDate(),
        bgcolor: "#fafafa",
        notas: 'hello',
        user: {
            _id: '1230',
            name: 'Fabbry'
        }
    }],
    activeEvent: {}
};

export const calendarReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state;
    }
}
